deck_description:
&nbsp;

This deck is very strong against powerful monsters or monsters who cannot be destroyed by battles or cards effects. Do a maximum of fusion summons using your oponent's monsters with predator counters as fusion materials (Lair of Darkness can be very useful for that too.) Synchro monsters can easily be summoned using Ophrys Scorpio + Banksiogre, and Instant Fusion can be used for summoning Thousand-Eyes Restrict for his effect and right after for summoning Dragostapelia on the field.

&nbsp;

This is a Yugioh Zexal/Zexal Manga Hybrid Character deck combining elements from both Reginald Castle Aka Shark and his alter ego, Nash the leader of the 7th Barian Emperors . My Character Decks are not meant for official Yugioh Tournaments. The link will show you why his deck is built the way it is.

